import { Col, Row, Typography } from 'antd';
import styles from './style.module.css';

const { Text, Title } = Typography;

function Footer() {

  const bodyS = {
    background: 'url("/images/footer-bg.png")',
  };

  return (<>
    <div className={` ${styles.body}`} style={bodyS}>
      <Row className='container py-5'>
        <Col span={12}>
          <Row className='mb-5'>
            <Col span={8}>
              <img src='/images/logo.webp' />
            </Col>
            <Col span={16}>
              <Title className='text-white'>Liên hệ</Title>
              <Row>
              <col span={4}>1111</col>
              <col span={20}>03 Hòa Bình, Phường 3, Quận 11, TP.Hồ Chí Minh<br />(Cổng số 2 Công viên Văn hóa Đầm Sen)</col>
              </Row>
              
            </Col>
          </Row>
          <Text>Copyright @ Công ty Cổ phần Dịch vụ Du lịch Phú Thọ (Phuthotourist)</Text>
        </Col>
        <Col span={12}></Col>
      </Row>
    </div>
  </>);
}
export default Footer;
